import React, { useState } from 'react';
import TextInput from './components/TextInput';
import ImageInput from './components/ImageInput';
import DropdownSelection from './components/DropdownSelection';
import UserLoginRegister from './components/UserLoginRegister';
import WishList from './components/WishList';

function Home() {
  const [username, setUsername] = useState('');
  return (
    <div>
      <header className="App-header" style={{ position: 'relative', padding: '20px' }}>
        <p
          style={{
            fontSize: '32px', // Larger font size
            fontWeight: 'bold', // Bold text
            textAlign: 'center', // Center the text horizontally
            marginTop: '0', // Optional: Adjust spacing above the text
          }}
        >
          Giftly
        </p>
        <TextInput username={username} />
        <ImageInput username={username} />
        <DropdownSelection username={username} />
        <UserLoginRegister setUsername={setUsername} />
        <WishList username={username} />
      </header>
    </div>
  );
}

export default Home;
